SELECT TOP ${number_of_logs} TIMESTAMP, CONCAT(RECORD:"severity_text", ': ', VALUE) AS LOG, * EXCLUDE (TIMESTAMP, VALUE, RECORD)
  FROM ${event_table} 
  WHERE ${event_table}.RECORD_TYPE='LOG'
  AND ${event_table}.RECORD:"severity_text" IN (${severity_levels:singlequote})
  AND ${event_table}.RESOURCE_ATTRIBUTES:"db.user" IN (${users:singlequote})
  AND ${event_table}.RESOURCE_ATTRIBUTES:"snow.warehouse.name" IN (${warehouses:singlequote})
  AND ${event_table}.RESOURCE_ATTRIBUTES:"snow.executable.name" IN (${executables:singlequote})
  AND ${event_table}.RESOURCE_ATTRIBUTES:"db.user" IN (${users:singlequote})
  AND ${event_table}.TIMESTAMP BETWEEN ${__from:singlequote} AND ${__to:singlequote}
  ORDER BY ${event_table}.TIMESTAMP DESC;

SELECT COUNT(*) AS " Number of Logs" 
  FROM
  (SELECT TOP ${number_of_logs} * FROM ${event_table} 
  WHERE ${event_table}.RECORD_TYPE='LOG'
  AND ${event_table}.RECORD:"severity_text" IN (${severity_levels:singlequote})
  AND ${event_table}.RESOURCE_ATTRIBUTES:"db.user" IN (${users:singlequote})
  AND ${event_table}.RESOURCE_ATTRIBUTES:"snow.warehouse.name" IN (${warehouses:singlequote})
  AND ${event_table}.RESOURCE_ATTRIBUTES:"snow.executable.name" IN (${executables:singlequote})
  AND ${event_table}.TIMESTAMP BETWEEN ${__from:singlequote} AND ${__to:singlequote}
  ORDER BY ${event_table}.TIMESTAMP DESC);
